import SlidingMenu from "./SlidingMail/SlidingMail";
import Header from "./Header/Header";
import MenuList from "./SlidingMail/MenuList";
export default function Information() {
  return (
    <>
      <Header />
      <MenuList />
      <SlidingMenu />
    </>
  );
}
